import React from 'react';
import logo from './logo.svg';
import SquareButton from './SquareButton'
import './App.css';
import Selector from "./selector"


function App() {


  return(
    <div id = "content">
    <div id = "buttonBlock">
    <SquareButton marginLeft= "500px" color="goldenrod"></SquareButton>
    <SquareButton marginLeft="600px" color="red"></SquareButton>
    <SquareButton marginLeft="700px" color= "slategrey"></SquareButton>
    <SquareButton marginLeft="800px" color = "darkcyan"></SquareButton>
  </div>
  <div id = "selectorblock">
   < Selector marginLeft = "450px">  </Selector>
  </div>
  </div>
  );
}

export default App;
